import PySimpleGUI as sg
import requests
import jsonpath
import pyperclip

indeximg = b''
url = "https://api.vc.bilibili.com/api/v1/drawImage/upload"
qrurl = "https://api.qrserver.com/v1/create-qr-code/?size=150×150&data= "
img_url = ''

headers = {
    'User-Agent': "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/103.0.0.0 Safari/537.36"
}
headers.update({
    'Origin': "https://t.bilibili.com",
    'Referer': "https://t.bilibili.com/",
})
data = {
    'biz': "draw",
    'category': "daily",
}
with open('SESSDATA.txt', 'r') as fs:
    SESSDATA = fs.read()
fs.close()

sg.theme('BlueMono')  # 设置当前主题
# 界面布局，将会按照列表顺序从上往下依次排列，二级列表中，从左往右依此排列
layout = [[sg.Text('点击“选择图片”上传', key='finalurl')],
          [sg.Image(indeximg, key='address'), sg.InputText('在这里输入新的SESSDATA')],
          [sg.Button('修改SESSDATA'), sg.Button('退出'), sg.Button('选择图片'), sg.Button('复制链接')]]

# 创造窗口
window = sg.Window('B站图床(补档姬版)', layout)
# 事件循环并获取输入值
while True:
    event, values = window.read()
    if event in (None, '退出'):  # 如果用户关闭窗口或点击`Cancel`
        break
    if event == '修改SESSDATA':
        SESSDATA = values[0]
        if values[0] == "在这里输入新的SESSDATA":
            sg.Popup("没事别乱点哦，bug很多的！")
            continue
        with open('SESSDATA.txt', 'w') as fs:
            fs.write(SESSDATA)
        fs.close()
        sg.popup("已替换为"+values[0])
    if event == '选择图片':
        imgadd = sg.popup_get_file('点击“Browse”导入图片')
        if imgadd is None:
            continue
        img = open(imgadd, 'rb')
        files = {
            'file_up': img,
        }
        cookies = {
            'SESSDATA': SESSDATA,
        }
        r = requests.post(url, data=data,
                          headers=headers,
                          cookies=cookies,
                          files=files, timeout=300
                          )
        j = r.json()
        img_url = jsonpath.jsonpath(j, '$.data.image_url')
        r.close()
        if img_url is False:
            sg.Popup("上传出错！可能是网络、文件、SESSDATA过期等问题！")
            continue
        qrcode = requests.get(qrurl+img_url[0])
        with open('test123.png', 'wb') as f:
            f.write(qrcode.content)
            f.close()
        qrcode.close()
        window['address'].update(filename='test123.png')
        window['finalurl'].update(img_url[0])
    if event == '复制链接':
        if img_url == '':
            continue
        pyperclip.copy(img_url[0])
        sg.Popup("已复制！")

window.close()
